"  <div id=\"topicTitle\">",
"   Patient information: Poor weight gain in infants and children (Beyond the Basics)",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
